column8:
ファーバーカステル伝統の、クラッシクな絵柄の缶に色鉛筆セット直径３．３ｍｍの太さの芯は、SV製法により芯が折れにくい構造になっています。また、軸部分には名前の書き込めるスペースがあるので、学校などのご使用にも便利です<strong><font color="#FF0000" size="-1">※こちらの商品は受注発注商品の為、ご注文後2～5営業日後の出荷予定となります。<br />※メーカー在庫切れの為5営業日以内に出荷できない場合はメールにてご案内させていただきます。</font></strong><br><table width="700" align="center"><tr><td colspan="2"><img src="http://image.rakuten.co.jp/econve/cabinet/parts/fc.gif" width="700" height="245"></td></tr><tr><td colspan="2" bgcolor="#EE1C23"><P><font size="4"><font color="#FFFFFF" size="6"><br>1761</font><font color="#FFFFFF"><strong>年カスパー・ファーバーがニューグンベルク郊外のシュタインで鉛筆の製造を開始。<br></strong><font size="6">1840</font><strong>年ローター・ファーバーが鉛筆全製品に”A.W.FABER”の刻印を入れ、鉛筆が初めてブランド品として認知されました。その後</strong><font size="6">1851</font><strong>年に、六角形デザインの鉛筆を発表。そして、この鉛筆の「長さ・太さ・硬度」が世界的基準となりませた。</strong><font size="6">1898</font><strong>年バイエルン王室認証のもとに、ファーバーカステル伯爵家が誕生。1905年世界で最も有名な鉛筆「CASTELL 9000番」を発表。1928年以降、世界各国に製造部門、販売会社を設立。現在、ファーバーカステル社は常に新しい分野の新製品開発に力を入れ、世界的ブランドに確立させるべく、弛まない努力を続けています。<br><br></strong></font></font></P></td></tr><tr><td width="176" rowspan="2" bgcolor="#FFFFFF"><font color="#000000"><img src="http://image.rakuten.co.jp/econve/cabinet/parts/rogomini.gif" width="200" height="70"></font></td><td width="469" align="center" valign="middle" bgcolor="#FFFFFF"><strong><font size="6">ファーバーカステル　色鉛筆</font></strong></td></tr><tr><td bgcolor="#FFFFFF"><font size="2">ファーバーカステル伝統の、クラッシクな絵柄の缶に色鉛筆セット直径３．３ｍｍの太さの芯は、SV製法により芯が折れにくい構造になっています。また、軸部分には名前の書き込めるスペースがあるので、学校などのご使用にも便利です。</font></td></tr></table><table width="700" border="1" align="center" cellpadding="5" cellspacing="0" bordercolor="#333333"><tr><td colspan="4"><font color="#000000" size="3">芯の太さ3.3ｍｍ</font></td></tr><tr><td width="92"><font color="#000000" size="3">１２色セット</font></td><td width="264"><font color="#000000" size="3">商品サイズ　　102.3×184.2×12.9ｍｍ　　　　</font></td><td width="89"><font color="#000000" size="3">重量　</font></td><td width="205"><font color="#000000" size="3">約136ｇ</font></td></tr><tr><td><font size="3">２４色セット</font></td><td><font size="3">商品サイズ　　201.7×188.2×14.1mm </font></td><td><font size="3">重量　　　</font></td><td><font size="3">約280g </font></td></tr><tr><td><font color="#000000" size="3">３６色セット</font></td><td><font color="#000000" size="3">商品サイズ　　296.0×190.0×13.5mm　　　 　　 </font></td><td><font color="#000000" size="3">重量　　</font></td><td><font color="#000000" size="3">約429g </font></td></tr></table><table width="700" align="center"><tr><td><img src="http://image.rakuten.co.jp/econve/cabinet/parts/iro.gif" width="700" height="216"></td></tr></table><style type="text/css">
